class PermyScript{constructor(t){this.string=t}get compile(){return this.encapsulate.split.nest.as_object}get split(){return new PermyScript(this.string.replaceAll("|",'","'))}get nest(){let t=this.string;for(let e=0;e<(this.string.match(/\(/g)||[]).length;e++)t=`${t}]]`;return t=t.replaceAll("(",'", ["'),t=t.replaceAll(")",'", ["'),new PermyScript(t)}get encapsulate(){return new PermyScript(`["${this.string}"]`)}get as_object(){return JSON.parse(this.string)}}module.exports=PermyScript;